905\u0930\u094d\u0927\u0947 \u0926\u0941\u0903\u0916\u00a0 \u0928\u093e\u0939\u0940\u0938\u0947 \u0939\u094b\u0908\u0932 .  Just \u0909\u0926\u093e\u0939\u0930\u0923 \u0935\u093e\u091a\u0915\u093e\u0902\u0928\u093e \u0915\u0933\u093e\u0935 \u092e\u094d\u0939\u0923\u0942\u0928, \u091c\u093f\u0935\u0902\u0924 \u0909\u0926\u093e\u0939\u0930\u0923 \u0926\u094d\u092f\u093e\u092f\u091a\u0947 \u091d\u093e\u0932\u0947 \u0924\u0930,  \u092e\u093e\u091d\u094d\u092f\u093e\u0915\u0921\u0947 \u0906\u0927\u0940 phone \u0928\u0935\u094d\u0939\u0924\u093e,\u092e\u0932\u093e \u0935\u093e\u091f\u093e\u092f\u091a\u0902 \u0915\u0940 \u092e\u093e\u091d\u094d\u092f\u093e\u0915\u0921\u0947 \u092b\u094b\u0928 \u0928\u093e\u0939\u0940 \u0906\u0939\u0947\u00a0 \u092e\u094d\u0939\u0923\u0942\u0928 \u092e\u093e\u091d\u094d\u092f\u093e\u092c\u0930\u094b\u092c\u0930 \u092b\u093e\u0930\u091a \u0935\u093e\u0908\u091f \u0935\u093e\u091f\u0924 \u0939\u094b\u0924 \u0906\u0939\u0947 \u092f\u093e\u0928\u0902\u0924\u0930 \u092e\u093e\u091d\u094d\u092f\u093e\u0915\u0921\u0947 \u092b\u094b\u0928 \u0906\u0932\u093e ,\u092a\u0923 \u092e\u093e\u091d\u094d\u092f\u093e\u0915\u0921\u0947 smart phone \u0928\u0935\u094d\u0939\u0924\u093e \u0924\u094d\u092f\u093e\u092e\u0941\u0933\u0947 \u092e\u093e\u091d\u094d\u092f\u093e\u0935\u0930\u091a \u0938\u0930\u094d\u0935 \u0926\u0941\u0903\u0916 \u0915\u094b\u0938\u0933\u0932\u0947 \u0906\u0939\u0947 \u0905\u0938\u0902 \u0935\u093e\u091f\u093e\u092f\u091a\u0902 !  \u0906\u0924\u093e \u092e\u093e\u091d\u094d\u092f\u093e\u0915\u0921\u0947 smart phone \u0938\u0941\u0927\u094d\u0926\u093e \u0906\u0939\u0947 , \u0906\u0924\u093e \u091c\u093e\u090a\u0928 \u092e\u0932\u093e \u0935\u093e\u091f\u0924 \u0906\u0939\u0947 \u0915\u0940 \u092e\u0940 \u0925\u094b\u0921\u093e \u0926\u0941\u0903\u0916 \u092e\u0941\u0915\u094d\u0924 \u0906\u0939\u0947. \u092a\u0923 \u0906\u091c \u092e\u0932\u093e \u0926\u093f\u0938\u0924\u0947 \u0915\u0940 \u091c\u0947 \u092e\u093e\u091d\u094d\u092f\u093e\u0939\u0942\u0928 \u0906\u091c\u094d\u091e\u093e\u0927\u093e\u0930\u0940 ,\u092e\u093e\u091d\u094d\u092f\u093e\u092a\u0947\u0915\u094d\u0937\u093e \u0935\u092f\u093e\u0928\u0947 , \u092e\u093e\u0928\u093e\u0928\u0947 \u092e\u094b\u0920\u0947 \u0905\u0938\u0932\u0947\u0932\u0947 \u090f\u0915 \u0938\u093e\u0927\u093e \u092e\u094b\u092c\u093e\u0908\u0932 \u092b\u094b\u0928 \u0935\u093e\u092a\u0930\u0924\u093e\u0924 , \u092a\u094d\u0930\u0936\u094d\u0928 \u0924\u094b \u0928\u093e\u0939\u0940 \u0915\u0940, \u092e\u093e\u091d\u094d\u092f\u093e\u0915\u0921\u0947 \u092b\u094b\u0928 \u0928\u0935\u094d\u0939\u0924\u093e \u092e\u094d\u0939\u0923\u0942\u0928 \u092e\u0932\u093e \u0926\u0941\u0903\u0916 \u0935\u093e\u091f\u093e\u092f\u091a\u0902 .\u092a\u094d\u0930\u0936\u094d\u0928 \u0924\u094b \u0906\u0939\u0947 \u0915\u0940, \u0906\u0924\u093e \u092e\u0940 \u091c\u094d\u092f\u093e \u0915\u0941\u0923\u093e\u0932\u093e \u091c\u094b \u0906\u0927\u0940 \u092e\u0940 \u092b\u094b\u0928 \u0935\u093e\u092a\u0930\u0924 \u0939\u094b\u0924\u094b\u00a0 \u0924\u0947 \u0935\u093e\u092a\u0930\u0924\u093e\u0928\u093e \u092c\u0918\u0924\u094b \u092e\u0932\u093e \u0935\u093e\u0908\u091f \u0935\u093e\u091f\u0924\u0947 .  \u092f\u093e \u0909\u0926\u093e\u0939\u0930\u0923\u093e\u0924\u0942\u0928 \u090f\u0935\u0922\u0902\u091a \u0915\u0933\u0935\u094d\u0939\u093e\u092f\u091a\u0902\u092f \u0915\u0940, \u0906\u092a\u0932\u094d\u092f\u093e\u092c\u0930\u094b\u092c\u0930 \u091c\u0947 \u0926\u0941\u0903\u0916 \u092a\u094d\u0930\u0938\u0902\u0917 \u0918\u0921\u0932\u0947\u0924 , \u0938\u092e\u091d\u093e \u0924\u0947\u091a \u092a\u094d\u0930\u0938\u0902\u0917 \u0926\u0941\u0938\u0931\u094d\u092f\u093e\u091a\u094d\u092f\u093e \u092c\u0930\u094b\u092c\u0930 \u0918\u0921\u0932\u0947 \u0924\u0930,\u0906\u092a\u0923 \u0924\u094d\u092f\u093e\u0902\u091a\u094d\u092f\u093e \u0926\u0941\u0903\u0916\u093e\u0924 \u0935\u094d\u092f\u0924\u0940\u0924 \u0939\u094b\u0924\u094b,\u0938\u0939\u092d\u093e\u0917\u0940 \u093
